INSERT INTO `settings_leave_types` (`id`, `company_id`, `leave_code`, `leave_name`, `leave_description`, `deduct_from_karkaard`, `deduct_from_vacation`, `deduct_from_ceiling`, `requires_letter`, `created_at`, `modified_at`) VALUES
(1, -1, 'ILLNESS', 'illness (extended)', 'employee has serious medical sitch (ex: gets hit by a car, cancer, etc) employer needs to bring doctors note as well as \r\nletter of auth from insurance board', 'yes', 'no', 'no', 'yes', '2017-08-19 16:14:21', '2017-08-19 16:14:21'),
(2, -1, 'TIME_OFF', 'time off (without payment)', 'emp asks for some time off, USUALLY means they do not have accruals, but manager approves time off', 'yes', 'no', 'no', 'no', '2017-08-19 16:14:53', '2017-08-19 16:14:53'),
(3, -1, 'SICK_TIME', 'sick time', 'emp is sick, misses a day or 2 (with dr''s note) ', 'no', 'no', 'yes', 'yes', '2017-08-19 16:16:22', '2017-08-19 16:16:22'),
(4, -1, 'DAY_OFF', 'day off (with payment)', 'asked for 3 days off to go out of town, approved, gets deducted from vacation accruals', 'no', 'yes', 'no', 'no', '2017-08-19 16:16:41', '2017-08-19 16:16:41'),
(5, -1, 'JOB_ABANDON', 'Job Abandonment', 'Occurs when an employee fails to show up as expected to work without notifying their supervisor (no call/no show) or\r\nrequesting the time off', 'yes', 'no', 'no', 'no', '2017-08-19 16:17:29', '2017-08-19 16:17:29'),
(6, -1, 'BONUS_TIME', 'bonus time off ', 'this is generally company wide, or perhaps team wide , or even employee level \r\n(the boss gives a week off {user defined} to all of the company, or a team, 1 person\r\nrewarding good work, or a good quarter ..\r\nso for programing, its a type of absence but the ux, we will discuss later, to avoid hr having to enter 33 exceptions', 'no', 'no', 'no', 'no', '2017-08-19 16:33:57', '2017-08-19 16:33:57'),
(7, -1, 'FAMILY_DEATH', 'death in family', 'maybe is based on employer and maybe even employee , so if they are in a good relationship, the employer \r\nwill not ask for one, if the employee is the boy that cried wolf and someone dies every month, well the boss may ask', 'no', 'no', 'no', 'optional', '2017-08-19 16:34:01', '2017-08-19 16:34:04'),
(8, -1, 'WEDDING', 'wedding', 'the maybe is based on employer and maybe even employee , so if they are in a good relationship, the employer \r\nwill not ask for one, if the employee has asked for 5 exceptions, well...{this is iran, we are allowed to have 4;))', 'no', 'no', 'no', 'optional', '2017-08-19 16:34:37', '2017-08-19 16:34:39'),
(9, -1, 'PREGNANCY_LEAVE', 'pregnancy leave', 'These 2 are a little different from the rest, because generally will be a pre determined time off ahead of time, meaning \r\na female employee is 8 months pregnant and talks to her boss, her boss will grant her 2 months (for ex, user defined)\r\ntime off for her to go have her child', 'no', 'no', 'no', 'no', '2017-08-19 16:35:32', '2017-08-19 16:35:32'),
(10, -1, 'NEWBORN_ALLOWANCES', 'newborn allowances', 'this one as well, meaning lets imagine after her kid is 6 months old, she returns to the work force, speaks to her boss \r\nand he will grant her an exception every day (labor law enforced) she can be excluded an hour (user defined) \r\noff early (or come in late) every day for a time period (ex 6 months, again user defined)', 'no', 'no', 'no', 'no', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
